// Modules //
import React from 'react';
import axios from 'axios';
import Fade from 'react-reveal/Fade';

// Style //
import { Container, Col, Row, Card } from 'react-bootstrap';
import './LanguesCoord.scss';

class Main extends React.Component {

  render() {
    return (
      <div className="div_diplomes">
        <Container>

            <Row>
            <Fade cascade>
            <Col>
                <h2 className="h2_diplomes">Langues Parlées</h2>
                <Card className="card_diplomes-all border-0">
                    <Card.Body className="card_diplomes">
                        <Card.Title>Développeur web</Card.Title>
                        <Card.Subtitle>Samsung Campus, Saint-Ouen</Card.Subtitle>
                    </Card.Body>
                </Card>
            </Col>
            </Fade>
          </Row>
        </Container>
      </div>
    );
  }
}

export default Main;
